    private static void diguiFunction(Object jsonObject, Map<String, String> hashMap) {

        if (jsonObject instanceof JSONObject) {
            for (Map.Entry<String, Object> entry : ((Map<String, Object>) jsonObject).entrySet()) {

                String key = entry.getKey();

                System.out.println(key);

                Object value = testJson(entry.getValue());

                if (value instanceof JSONObject) {
                    diguiFunction(value, hashMap);
                } else if (value instanceof JSONArray) {
                    diguiFunction(value, hashMap);
                } else {
                    // 记录重复的 key
                    if (hashMap.containsKey(key)) {
                        String sameKey = hashMap.get("sameKey");
                        if (!sameKey.contains(key)) {
                            hashMap.put("sameKey", sameKey + "," + key);
                        }
                    }
                    hashMap.put(key, String.valueOf(value));
                }
            }
        } else if (jsonObject instanceof JSONArray) {
            JSONArray array = (JSONArray) jsonObject;
            for (Object o : array) {
                diguiFunction(o, hashMap);
            }
        } else {
            //JsonArray会存在缺失名字问题,后续有空修改
            System.out.println("jsonObject : " + jsonObject);
        }

    }


    public static Object testJson(Object jsonStr) {
        try {
            if (jsonStr instanceof JSON) {
                return jsonStr;
            } else {
                Object object = JSON.parse(jsonStr instanceof String ? (String) jsonStr : jsonStr.toString());
                return object;
            }
        } catch (Exception e) {
            return jsonStr;
        }
    }


